drop table if exists snowy.snowy_china_areas;

CREATE TABLE snowy.snowy_china_areas
(
    id int(11) unsigned PRIMARY KEY NOT NULL AUTO_INCREMENT,
    p_id int(11) unsigned NOT NULL,
    name varchar(50) NOT NULL,
    zip_code varchar(6) NOT NULL
);

drop table if exists snowy.snowy_dictionary;
CREATE TABLE snowy.snowy_dictionary
(
    id int(11) PRIMARY KEY NOT NULL COMMENT 'id' AUTO_INCREMENT,
    pid int(11) COMMENT '父节点ID',
    `key` varchar(100) COMMENT 'key 键',
    value varchar(512) COMMENT 'value 值(默认中文)',
    value_en_us varchar(256) COMMENT '/*value值（对应英文）*/',
    description varchar(255) COMMENT 'description 描述',
    create_time datetime COMMENT '创建时间',
    update_time datetime COMMENT '更新时间'
);

drop table if exists snowy.snowy_sys_icon;
CREATE TABLE snowy.snowy_sys_icon
(
    id int(11) PRIMARY KEY NOT NULL COMMENT '当前ID，如果是父节点，那么为ICON集合的分类（如Bootstrap等）' AUTO_INCREMENT,
    pid int(11) NOT NULL COMMENT '父节点ID',
    name varchar(64),
    value varchar(64)
);

drop table if exists snowy.snowy_sys_resc;
CREATE TABLE snowy.snowy_sys_resc
(
    resc_id int(11) PRIMARY KEY NOT NULL COMMENT 'id' AUTO_INCREMENT,
    resc_pid int(11) COMMENT '父id',
    resc_name varchar(50) COMMENT '名称',
    resc_url varchar(150) DEFAULT '#' COMMENT 'URL',
    resc_level int(1) COMMENT '层级(不超过10层)',
    resc_sort int(2) COMMENT '排序(不超过100)',
    resc_type char(1) DEFAULT '0' COMMENT '权限类型 默认：0 后台权限：1',
    resc_icon_name varchar(32),
    resc_html_id varchar(50) DEFAULT '#' COMMENT '指定的ID号，可随机生成，用于导航菜单非重设置',
    create_time datetime COMMENT '创建时间',
    enable_status char(1) DEFAULT '0' COMMENT '是否停用 默认：0 停用：1',
    remark varchar(100) COMMENT '备注'
);



drop table if exists snowy.snowy_sys_role;
CREATE TABLE snowy.snowy_sys_role
(
    role_id int(11) PRIMARY KEY NOT NULL COMMENT 'id' AUTO_INCREMENT,
    role_name varchar(50) COMMENT '名称',
    role_type char(1) DEFAULT '0' COMMENT ' 角色类型 默认：0 后台角色：1',
    role_remark varchar(100) COMMENT '备注',
    role_sort int(2) COMMENT '排序(不超过100)',
    create_time datetime COMMENT '创建时间',
    enable_statue char(1) DEFAULT '0' COMMENT '是否停用 默认：0 停用：1'
);

drop table if exists snowy.snowy_sys_role_resc;
CREATE TABLE snowy.snowy_sys_role_resc
(
    id int(11) PRIMARY KEY NOT NULL COMMENT 'id' AUTO_INCREMENT,
    resc_id int(11) COMMENT 'id',
    role_id int(11) COMMENT 'id',
    CONSTRAINT FK_Reference_1 FOREIGN KEY (resc_id) REFERENCES snowy.snowy_sys_resc (resc_id),
    CONSTRAINT FK_Reference_2 FOREIGN KEY (role_id) REFERENCES snowy.snowy_sys_role (role_id)
);
CREATE INDEX FK_Reference_1 ON snowy.snowy_sys_role_resc (resc_id);
CREATE INDEX FK_Reference_2 ON snowy.snowy_sys_role_resc (role_id);

drop table if exists snowy.snowy_sys_role_user;
CREATE TABLE snowy.snowy_sys_role_user
(
    id int(11) PRIMARY KEY NOT NULL COMMENT 'id' AUTO_INCREMENT,
    role_id int(11) COMMENT 'id',
    user_id int(11) COMMENT 'id',
    CONSTRAINT FK_Reference_3 FOREIGN KEY (role_id) REFERENCES snowy.snowy_sys_role (role_id),
    CONSTRAINT FK_Reference_4 FOREIGN KEY (user_id) REFERENCES snowy.snowy_user_info (user_id)
);
CREATE INDEX FK_Reference_3 ON snowy.snowy_sys_role_user (role_id);
CREATE INDEX FK_Reference_4 ON snowy.snowy_sys_role_user (user_id);

drop table if exists snowy.snowy_user_info;
CREATE TABLE snowy.snowy_user_info
(
    user_id int(11) PRIMARY KEY NOT NULL COMMENT 'id' AUTO_INCREMENT,
    user_name varchar(80) COMMENT '登录账号',
    nick_name varchar(50) COMMENT '昵称',
    real_name varchar(30) COMMENT '姓名',
    sha_value varchar(512) COMMENT '随机盐值',
    sha_password varchar(1024) COMMENT '登录密码（盐值哈希后）',
    user_email varchar(150) COMMENT '个人网站',
    user_avatar varchar(512) COMMENT '头像路径',
    user_signature varchar(255) COMMENT '个性签名',
    login_status char(1) DEFAULT '0' COMMENT '是否登录状态 默认：0 在线：1',
    user_status int(11) DEFAULT '1' COMMENT '用户状态 0：新注册，不可用；1：注册可用状态；2：连续登陆错误，禁止使用；3：多地异常登陆，禁止使用；9：用户被删除，禁止使用。',
    create_time datetime COMMENT '创建时间',
    update_time datetime COMMENT '更新时间',
    last_login_time datetime COMMENT '最后登录时间',
    last_login_ip varchar(15) COMMENT '最后登录IP',
    last_login_country varchar(32),
    last_login_province varchar(32),
    last_login_city varchar(32)
);